import React from 'react';
import { Link } from 'react-router-dom';

const Landing = () => {
    return (
        <div class="flex flex-col items-center justify-center h-screen bg-ucfGold text-ucfBlack">
    <h1 class="text-2xl font-bold">Welcome to the Golf Club</h1>
    <div class="mt-5 flex gap-2">
        <Link to="/login">
            <button class="px-4 py-2 text-ucfWhite bg-ucfBlack rounded hover:bg-ucfDarkGray">
                Login
            </button>
        </Link>
        <Link to="/register">
            <button class="px-4 py-2 text-ucfWhite bg-ucfBlack rounded hover:bg-ucfDarkGray">
                Register
            </button>
        </Link>
    </div>
</div>

    );
};

export default Landing;
